"original": |2-
     In the case of two (or more) supported attribute values that are in
     conflict with one another (although each is supported independently,
     the values conflict when requested together within the same Job), the
     Printer MUST return all the values that it ignores or substitutes to
     resolve the conflict but not any of the values that it is still
     using.  The choice for exactly how to resolve the conflict is
     implementation dependent.  See Section 4.2.1.2 and Appendix C.  See
     the Implementor's Guides [RFC3196] [PWG5100.19] for examples.
"fixed": |-
  In the case of two (or more) supported attribute values that are in conflict with one another (although each is supported independently, the values conflict when requested together within the same Job), the Printer MUST return all the values that it ignores or substitutes to resolve the conflict but not any of the values that it is still using.  The choice for exactly how to resolve the conflict is implementation dependent.  See Section 4.2.1.2 and Appendix C.  See the Implementor's Guides [RFC3196] [PWG5100.19] for examples.
"ko": |-
  두 개 이상의 지원되는 속성 값이 서로 충돌하는 경우(각각은 독립적으로 지원되지만 동일한 작업 내에서 함께 요청하면 값이 충돌함) 프린터는 무시하거나 대체하는 모든 값을 반환해야 합니다. 충돌을 해결하지만 아직 사용 중인 값은 해결하지 못합니다. 충돌을 해결하는 정확한 방법에 대한 선택은 구현에 따라 다릅니다. 섹션 4.2.1.2 및 부록 C를 참조하세요. 예제는 구현자 가이드 [RFC3196] [PWG5100.19]를 참조하세요.
